import React, { Component } from "react";
import { Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser } from "../../redux/";
import InnerPageBanner from "../layout/InnerPageBanner";

class Register extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: "",
      password: "",
      password2: "",
      errors: {},
    };
  }

  componentDidMount() {
    // If logged in and user navigates to Register page, should redirect them to dashboard
    if (this.props.auth.isAuthenticated) {
      this.props.history.push("/dashboard");
    }
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors,
      });
    }
  }
  onChange = (e) => {
    this.setState({ [e.target.id]: e.target.value });
  };

  onSubmit = (e) => {
    e.preventDefault();
    const newUser = {
      name: this.state.name,
      email: this.state.email,
      password: this.state.password,
      password2: this.state.password2,
    };
    this.props.registerUser(newUser, this.props.history);
  };

  render() {
    const { errors } = this.state;
    return (
      <div>
        <InnerPageBanner />
        <section className="contact_form py-5">
          <div className="container">
            <div className="heading">
              <h1 className="heading text-capitalize mb-5 pb-3">
                <span>Register</span>
              </h1>
              <h4 className="position cont">Register</h4>
            </div>
            <form noValidate onSubmit={this.onSubmit}>
              <div className="input-w3ls w3ls-left">
                <input
                  onChange={this.onChange}
                  onChange={this.onChange}
                  value={this.state.name}
                  error={errors.name}
                  id="name"
                  type="text"
                  placeholder="Name"
                  className={classnames("", {
                    invalid: errors.name,
                  })}
                />
                <span className="text-danger font-weight-bold">
                  {errors.name}
                </span>
              </div>
              <div className="input-w3ls w3ls-rght">
                <input
                  onChange={this.onChange}
                  value={this.state.email}
                  error={errors.email}
                  id="email"
                  type="email"
                  placeholder="Email"
                  className={classnames("", {
                    invalid: errors.email,
                  })}
                />
                <span className="text-danger font-weight-bold">
                  {errors.email}
                </span>
              </div>
              <div className="input-w3ls w3ls-left">
                <input
                  onChange={this.onChange}
                  value={this.state.password}
                  error={errors.password}
                  id="password"
                  type="password"
                  placeholder="Password"
                  className={classnames("", {
                    invalid: errors.password,
                  })}
                />
                <span className="text-danger font-weight-bold">
                  {errors.password}
                </span>
              </div>
              <div className="input-w3ls w3ls-rght">
                <input
                  onChange={this.onChange}
                  value={this.state.password2}
                  error={errors.password2}
                  id="password2"
                  type="password"
                  placeholder="Confirm Password"
                  className={classnames("", {
                    invalid: errors.password2,
                  })}
                />
                <span className="text-danger font-weight-bold">
                  {errors.password2}
                </span>
              </div>
              <div className="input-w3ls">
                <input type="submit" value="Register" />
              </div>
            </form>
          </div>
        </section>
        {/* <div className="row">
          <div className="col s8 offset-s2">
